    /* FONCTION UTILISEE */
    async selectImage(){
        
        const actionSheet = await this.actionSheetController.create({
            header: "localisations d'images",
            buttons: [
                {
                    text: 'Nos suggestions',
                    handler: ()=>{
                        this.openImagesSuggest();
                    }
                },
                {
                    text: 'Votre Galerie',
                    handler: ()=>{
                        this.takePicture(this.camera.PictureSourceType.PHOTOLIBRARY);
                    }
                },
                {
                    text: 'Prendre une photo',
                    handler: ()=>{
                        this.takePicture(this.camera.PictureSourceType.CAMERA);
                    }
                },
                {
                    text: 'Annuler',
                    role: 'cancel'
                }
            ]
        });

        await actionSheet.present();
    }
    openImagesSuggest(){
      $(".show-cat-images").show(500);
      $(".show-cat-input").hide(700);
    }

    hideImagesSuggest(){
      $(".show-cat-images").hide(500);
      $(".show-cat-input").show(700);
    }
    getImage(image){
      this.image = image;
      this.hideImagesSuggest();
    }
    /* fonction utilisee */
    takePicture(sourceType: PictureSourceType) {

        const options : CameraOptions = {
            quality: 100,
            sourceType: sourceType,
            saveToPhotoAlbum: false,
            correctOrientation: true,
              destinationType: this.camera.DestinationType.DATA_URL
        };

        this.camera.getPicture(options).then(imagePath =>{
            this.image = 'data:image/jpeg;base64,' + imagePath;
        });
    }




    async presentToast(message,color) {
        const toast = await this.toast.create({
            position:'top',
            message:message,
            duration: 5000,
            color:color
        });
        toast.present();
    }
